import { faDiscord } from '@fortawesome/free-brands-svg-icons';
import React, { forwardRef } from 'react';
// import { Link } from 'react-feather';
import Link from 'next/link';
import { useRouter } from 'next/router';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSquare } from '@fortawesome/free-solid-svg-icons';

const Header2 = forwardRef((props, ref: React.ForwardedRef<HTMLDivElement>) => {
	const currentHref = useRouter().pathname;
	props;
	console.log('CURRENT HREF', currentHref);

	return (
		<div
			ref={ref}
			className="w-full px-6 bg-primary-bg flex items-center border-b-1 border-primary-border"
			style={{ height: '78px', maxHeight: '85px' }}
		>
			<div className="flex flex-col py-4">
				<Link href="/">
					<h3 className="cursor-pointer font-extrabold flex items-center">
						{/* <span className="text-primary-color">Redacted</span>Name */}
						<FontAwesomeIcon icon={faSquare} className="mr-3" />
						Athena{' '}
						{/* <span className="font-medium uppercase text-lg ml-2">Bot</span> */}
					</h3>
				</Link>

				{/* <p className="text-secondary-text uppercase">The #1 Build Store</p> */}
			</div>
			<div className="h-full ml-24">
				<ul className="flex items-center gap-6 h-full">
					{[
						// { display: 'Home', href: '/' },
						{ display: 'Docs', href: '/store' },
						{ display: 'Support', href: '/pricing' },
						{ display: 'Status', href: '/support' },
					].map((link) => {
						return (
							<Link href={link.href}>
								<a className="h-full flex items-center px-3">{link.display}</a>
							</Link>
						);
					})}
				</ul>
			</div>
			<div className="flex-1 w-fit flex items-center justify-end">
				<Link href="https://discord.gg/eEFcyVfFU2">
					<a
						target="_blank"
						className="py-2 px-4 flex items-center text-white rounded-md bg-primary-color"
						// style={{ backgroundColor: '#7289DA' }}
					>
						<FontAwesomeIcon icon={faDiscord} />
						<span className="ml-2">Log in via discord</span>
					</a>
				</Link>
			</div>
		</div>
	);
});

export default Header2;
